import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail'

const App = () => {
    return (
        <div className="ui container comments">
            <CommentDetail 
                avatar={faker.image.avatar()} 
                author="Sam" 
                timeAgo="Today at 5:00PM" 
                text="Cool blog post!"
            />
            <CommentDetail 
            avatar={faker.image.avatar()} author="Jane" timeAgo="Yesterday at 5:00PM" text="Nice blog post!"/>
            <CommentDetail avatar={faker.image.avatar()} author="Alex" timeAgo="Yesterday at 3:00PM" text="Sweet blog post!"/>

        </div>
    );
};

ReactDOM.render(<App />, document.querySelector('#root'));
